import './App.css';

function App() {
  return (
    <div className="App">
      <div class={"nev"}>
        <a>Upcoming races</a>
        <a>My Races</a>
        <a>My Teams</a>
        <a>Garage</a>
      </div>
    </div>
  );
}

export default App;
